import React from 'react';
import './FAQ.css';

const FAQ = () => {
  return (
    <div className="faq-container">
      <h1 className="faq-title">Frequently Asked Questions</h1>
      <div className="faq-section">
        <div className="faq-item">
          <h2>1. What is Food Synergism?</h2>
          <p>Food synergism refers to the interaction between different foods that, when consumed together, enhance nutrient absorption and provide superior health benefits compared to when consumed separately.</p>
        </div>

        <div className="faq-item">
          <h2>2. How do food pairings improve health?</h2>
          <p>Effective food pairings can increase the bioavailability of essential nutrients, making them more accessible for absorption by the body and boosting overall health.</p>
        </div>

        <div className="faq-item">
          <h2>3. Are these pairings suitable for all diets?</h2>
          <p>Yes, these pairings can be tailored to meet the needs of various diets, including vegetarian, vegan, and non-vegetarian lifestyles.</p>
        </div>

        <div className="faq-item">
          <h2>4. Why are some foods better absorbed with others?</h2>
          <p>Certain nutrients require additional compounds for optimal absorption. For instance, vitamin C significantly enhances the absorption of non-heme iron found in plant-based foods.</p>
        </div>

        <div className="faq-item">
          <h2>5. Can I use these pairings to prevent disease?</h2>
          <p>Yes. Strategic food pairings can support immunity, improve digestion, and help lower the risk of chronic conditions such as cardiovascular disease, diabetes, and osteoporosis.</p>
        </div>

        {/* You can add more FAQ items here */}
      </div>
    </div>
  );
};

export default FAQ;
